def refine_data(group):

    Count_Reduce = group[0]
    Amt_Reduce = group[1]

    count_total = 0
    for bit in Count_Reduce:
        count_total += bit[1]

    amt_total = 0
    for bit in Amt_Reduce:
        amt_total += bit[1]        

    count_sorted = sorted(Count_Reduce, reverse=True)
    amt_sorted = sorted(Amt_Reduce, reverse=True)

    count_density = [(x[0], x[1]/count_total) for x in count_sorted]
    amt_density = [(x[0], x[1]/amt_total) for x in amt_sorted]

    count_x_val = [x[0] for x in count_density]
    count_y_val = [x[1] for x in count_density]

    amt_x_val = [x[0] for x in amt_density]
    amt_y_val = [x[1] for x in amt_density]

    return count_x_val, count_y_val, amt_x_val, amt_y_val

def plot_data(groups):

    fig, axes = plt.subplots(len(groups), 2, sharey=True, sharex=True, figsize=(6, 12))
    
    year_cnt = 0
    for row in axes:
        cycle = groups[year_cnt]
        count_x_val, count_y_val, amt_x_val, amt_y_val = refine_data(cycle)

        row[0].bar(count_x_val, count_y_val, width=0.05)
        row[1].bar(amt_x_val, amt_y_val, width=0.05)
        row[0].yaxis.set_visible(False)
        if year_cnt == 0:
            row[0].set_title("Number of Contributions")
            row[1].set_title("Value of Contributions")

        if year_cnt == len(groups) -1 :
            row[0].set_xlabel("CF Score")
            row[1].set_xlabel("CF Score")            

        year_cnt += 1

    plt.suptitle('Density Across Cycles by Ideology')
    plt.ylim([0,0.18])
    plt.xlim([-2.1, 2.1])
    plt.xticks([-2, -1, 0, 1, 2])

    # plt.show()
    plt.savefig("Output/Ideology.png")


